# Generate a list of random strings
    random_strings = [
        ''.join(random.choices(string.ascii_lowercase, k=string_length)) for i in range(num_strings)
    ]
    # Count the frequency of each character across all strings
    char_count = Counter()
    for s in random_strings:
        char_count += Counter(s)
    # Convert the character counts to a list of tuples and sort by count in descending order
    return sorted(char_count.items(), key=lambda x: x[1], reverse=True)

random.seed(0)

    char_count = Counter()

    for _ in range(num_strings):
        random_str = ''.join(
            random.choice(string.ascii_lowercase)
            for _ in range(string_length)
        )
        char_count.update(random_str)

    sorted_char_count = sorted(
        char_count.items(), key=lambda x: x[1], reverse=True
    )
    return sorted_char_count

if not isinstance(num_strings, int):
        raise TypeError('The num_strings parameter must be an integer')
    if not isinstance(string_length, int):
        raise TypeError('The string_length parameter must be an integer')
    if num_strings < 1:
        raise ValueError('The num_strings parameter must be a positive integer')
    if string_length < 1:
        raise ValueError('The string_length parameter must be a positive integer')
    chars = [''.join(random.choices(string.ascii_lowercase, k=string_length)) for _ in range(num_strings)]
    counter = Counter(''.join(chars))
    return counter.most_common()
